fetch("https://api.themoviedb.org/3/trending/movie/week?api_key=undefined").then((e=>e.json())).then((e=>function(e){console.log(e);const n=document.getElementById("trending-body");n.innerHTML="",e.forEach((e=>{n.innerHTML+=`<div class="movie-card-${e.id} movie-card">\n            <div class="movie-image">\n                <img src="https://image.tmdb.org/t/p/w500${e.poster_path}" alt="${e.title}">\n                <div class="movie-title">\n                    ${e.title}\n                </div>\n            </div>\n        </div>\n        `}))}(e.results))).catch((e=>console.error("Error:",e)));